import React, { useState, useEffect } from 'react';

function FacultyDirectory() {
  const [facultyMembers, setFacultyMembers] = useState([]);

  useEffect(() => {
    // Fetch the faculty data from your API or server
    fetch('/api/faculty-directory')
      .then(response => response.json())
      .then(data => setFacultyMembers(data))
      .catch(error => console.error('Error fetching faculty data:', error));
  }, []);

  return (
    <div className="faculty-directory">
      <h1>Faculty Directory</h1>
      {facultyMembers.map(member => (
  <div key={member.id} className="faculty-member">
    <img src={member.photoUrl} alt={member.name} />
    <h2>{member.name}</h2>
    <p>{member.title}</p>
    <p>Department: {member.department}</p>
    <p>Email: {member.email}</p>
    <p>Phone: {member.phone}</p>
    <p>Office: {member.office}</p>
    <p>Research Interests: {member.researchInterests.join(', ')}</p>
    <p>Courses Taught: {member.coursesTaught.join(', ')}</p>
    <p>Publications: {member.publications.join(', ')}</p>
  </div>
))}

    </div>
  );
}

export default FacultyDirectory;
